import styled from 'styled-components';
import {BrowserRouter as Router, Link, Route} from 'react-router-dom';
import {Button} from 'reactstrap';


export default function Landing (props) {


    return (
        // Render the Pizza component 
        <div> 
            <StyledBanner>
                <div className='image-wrapper'> 
                    <img className='banner' src= 'https://relaxedpowerful.s3.us-east-2.amazonaws.com/landing-banner.jpg' alt='banner'/> 
                </div>
                <div className='headline'>
                    <h1>
                        Co-Make
                    </h1>
                    <h3>
                        The best place for community cooperation
                    </h3>
                </div>
                    <div className='buttons-container'> 
                    <Button color='primary' className='join'>
                        Join us 
                    </Button>
                    <Button color='primary' className='login'>
                        Existing Member? Login
                    </Button>
                    </div>
            </StyledBanner>            
        </div>

    )
};

const StyledBanner =styled.div `
border: green 2px dashed;

position: relative;
margin-top: 20px;    
display: flex;
flex-flow: column wrap;
justify-content: center;
align-items: center;

    .image-wrapper{
        border: 1px red solid;
        display: flex;
        flex-flow: column wrap;
        justify-content: center;
        align-items: center;
        /* max-width: 90%; */
        max-height: 20%;
    }
    .banner {
        width: 100%;
        height: auto;
    }
    .headline {
        position: absolute;
        color: black;
        transform: translate(-50%, -50%);
    }
    .buttons-container {
        display: flex;
        min-width: 40%;
        justify-content: center;
    }
    .quick-order{
        min-width: 100px;
    }
    p{
        margin-top: 10px;
    }
`
